svg.script:

 var currentNode;
 function clickEf() {
           const nodo = this.querySelector('title');
           const title = nodo.textContent;
           console.log('Titulo del elemento:', title);
           this.classList.add("hidden");
     }

function getConnectedNodesEdges(selectedNodeN,levels) {
 const connectedNodes = new Set();
 var nodeList = [];
 if ( selectedNodeN !== null ) {
   if ( levels === 1 ) {
    nodeList.push(selectedNodeN);
   }  else {  // ( levels = 2  por defecto )
    nodeList = Array.from(getConnectedNodes(selectedNodeN)) // 1rst level
   }
  // Get all the nodes and edges from the SVG
  const nodes = document.querySelectorAll('g.node');
  const edges = document.querySelectorAll('g.edge');
  // Create a set to store the connected nodes and edges (to avoid duplicates)
  connectedNodes.add(selectedNodeN);

 // Iterate through the list
  nodeList.forEach( anode => {
  const selectedNodeTit = anode.querySelector('title').textContent;
  // Iterate through the edges
  edges.forEach(edge => {
    // Get the source and target node IDs from the edge's title
    const title = edge.querySelector('title');
    const [sourceId, targetId] = title.textContent.split('->');
    // Get the node elements for the source and target IDs
    const sourceNode = Array.from(nodes).find(node => node.querySelector('title').textContent === sourceId);
    const targetNode = Array.from(nodes).find(node => node.querySelector('title').textContent === targetId);
    // If the selected node ID matches the source or target, add the other node to the set
    if (sourceNode && (sourceNode.querySelector('title').textContent === selectedNodeTit)) {
      connectedNodes.add(targetNode);
      connectedNodes.add(edge);
    } else if (targetNode && (targetNode.querySelector('title').textContent === selectedNodeTit)) {
      connectedNodes.add(sourceNode);
      connectedNodes.add(edge);
    }
   });
 }) ;
 };
  // Return the connected nodes/edges as as set
  return (connectedNodes);
}

function getConnectedNodes(selectedNodeN) {
  const selectedNodeTit = selectedNodeN.querySelector('title').textContent;
  // Get all the nodes  from the SVG
  const nodes = document.querySelectorAll('g.node');
  const edges = document.querySelectorAll('g.edge');
  // Create a set to store the connected nodes and edges (to avoid duplicates)
  const connectedNodes = new Set();
  connectedNodes.add(selectedNodeN);
  // Iterate through the edges
  edges.forEach(edge => {
    // Get the source and target node IDs from the edge's title
    const title = edge.querySelector('title');
    const [sourceId, targetId] = title.textContent.split('->');
    // Get the node elements for the source and target IDs
    const sourceNode = Array.from(nodes).find(node => node.querySelector('title').textContent === sourceId);
    const targetNode = Array.from(nodes).find(node => node.querySelector('title').textContent === targetId);
    // If the selected node ID matches the source or target, add the other node to the set
    if (sourceNode && (sourceNode.querySelector('title').textContent === selectedNodeTit)) {
      connectedNodes.add(targetNode);
    } else if (targetNode && (targetNode.querySelector('title').textContent === selectedNodeTit)) {
      connectedNodes.add(sourceNode);
   }
  });
  // Return the connected nodes as a set
  return (connectedNodes);
}

function encender(nodo,levels) {
      document.querySelector('g').classList.add("hidden")
      const lista = Array.from(getConnectedNodesEdges(nodo,levels));
      lista.forEach( element => {
        element.classList.add("visible")
      } );
}
function apagar(nodo) {
      document.querySelector('g').classList.remove("hidden");
}
function apagarTodo() {
      document.querySelector('g').classList.remove("hidden");
      const nodes = document.querySelectorAll('g.node');
      const edges = document.querySelectorAll('g.edge');
      nodes.forEach( element => {
        element.classList.remove("visible")
      } );
      edges.forEach( element => {
        element.classList.remove("visible")
      } );
}
 function seeVisible() {
    listan = document.querySelectorAll('g.node.visible');
    projects = [];
    orgs = [];
    listan.forEach( element => {
      if ( element.querySelector('a').getAttributeNS("http://www.w3.org/1999/xlink", "href").includes('europa.eu/project') ) {
           projects.push("\t" + 
                         element.querySelector('a').getAttributeNS("http://www.w3.org/1999/xlink", "title") + 
                         ": https://cordis.europa.eu/project/id/" +
                         element.querySelector('title').textContent)  ;
      } else {
           orgs.push("\t" +  element.querySelector('text').textContent + 
           ": https://dashboard.tech.ec.europa.eu/qs_digit_dashboard_mt/public/sense/app/dc5f6f40-c9de-4c40-8648-015d6ff21342/sheet/3bcd6df0-d32a-4593-b4fa-0f9529c8ffb0/state/analysis/select/Organisation%20PIC/" +
           element.querySelector('title').textContent) ;
      }
    } );

   texto = "Projects:\n" + projects.sort().join('\n') + "\nOrganizations:\n" + orgs.sort().join('\n') + "\n";
   navigator.clipboard.writeText(texto).then(function(){
       console.log('Listas copiadas al portapapeles');
       beep();
    }, function(err) {
       console.error('Error en la copia: ',err);
   }) ;
 }
 function  mouseOverEf() {
          currentNode = this;
          this.classList.add("hidden");  
 } 
 function mouseOutEf() {
          currentNode = null;
          this.classList.remove("hidden");
}
document.onkeydown = function(e) {
  if (  e.altKey ) {
    if (  e.which === 82) { //alt+R two levels
        encender(currentNode,2);
        return false; // Prevent default action
    }
    if (  e.which === 84) { //alt+T see all (but remember)
        apagar(currentNode);
        return false; // Prevent default action
    }
    if (  e.which === 67) { //alt+C clear
        apagarTodo();
        return false; // Prevent default action
    }
    if ( e.which === 80) { //alt+P to the clipboard
        seeVisible();
        return false; // Prevent default action
    }
    if ( e.which === 83) { //alt+S (short) one level
        encender(currentNode,1);
        return false; // Prevent default action
    }
 }
}
function beep() {
    var snd = new Audio("data:audio/wav;base64,");  
    snd.play();
}
 // Assuming you have loaded the SVG file into the DOM
       const svg = document.querySelector('svg');
       const graph = document.querySelector('g');
       const subg = graph.querySelectorAll('g');
       const subgraphs = Array.from(subg).filter( a => ( a.getAttribute("class") === 'node' ));
  // Add a click event listener to each subgraph
       subgraphs.forEach(subgraph => {
         subgraph.addEventListener('mouseover', mouseOverEf);
         subgraph.addEventListener('mouseout', mouseOutEf);
	   });
  // If there is a reference to a node or list in the search, activate it:  ...?node=101100564
    const params = new URLSearchParams(window.location.search);
    const nodoIni = params.get('node');
    if (nodoIni !== null ) {
      const levelS = params.get('level') || 2;
      const nodes = document.querySelectorAll('g.node');
      listNodes = nodoIni.split(";").map(str => str.trim());
      listNodes.forEach( nodoSearch => {
         refNode = Array.from(nodes).find(node => node.querySelector('title').textContent === nodoSearch );
         if ( refNode === undefined ) {
            refNode = Array.from(nodes).find(node => node.querySelector('a').getAttributeNS("http://www.w3.org/1999/xlink",
                                                                                         "title") === nodoSearch);
          };
         if ( refNode !== undefined ) {
            encender(refNode,Number(levelS)); 
          };
      });
   }
